script: |
  super -f text -I q1965.spq | sort > q1965.out

inputs:
  - name: q1965.spq
    data: |
      SELECT - col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( - + col1 + - + col1 * 12 * + 81 * 94 / col0 * 48 IS NULL );
  - name: tab2

outputs:
  - name: q1965.out
    data: |
      -23
      -40
      -58
